import { Container, Form, Button } from 'react-bootstrap';
import React from 'react'
import {Link} from 'react-router-dom'
import styled from 'styled-components';
import logo from '../images/logo.svg';


export default function Login() {
  return (
    // <Container className="h-100 align-middle justify-content-center">

    //   <h1 className='text-center w-100 my-4'>Hey, welcome back!</h1>
    //   <div className="w-50 m-auto d-flex border justify-content-center">
    //     <div>
    //     <Form>
    //       <Form.Group className="mb-3" controlId="formBasicEmail">
    //         <Form.Label>Email address</Form.Label>
    //         <Form.Control type="email" placeholder="you@example.com" />
    //       </Form.Group>

    //       <Form.Group className="mb-3" controlId="formBasicPassword">
    //         <Form.Label>Password</Form.Label>
    //         <Form.Control type="password" placeholder="Password" />
    //         <Form.Text >
    //           <Link>Forgot password?</Link>
    //         </Form.Text>
    //       </Form.Group>
    //       <Form.Group className="mb-3" controlId="formBasicCheckbox">
    //         <Form.Check type="checkbox" label="Remember me" />
    //       </Form.Group>
    //       {['Log In','Facebook','Google','Twitter'].map((label)=>(
    //         <Button className='w-100 mb-2'> 
    //           {label}
    //         </Button>

    //         )
    //       )}
    //     </Form>
    //     </div>
    //   </div>
    // </Container>


    <div style={{backgroundColor: 'var(--base-20)', width: '100vw', height: '100vh'}}>
      <div className="d-flex w-75 m-auto">
        <a href="/"><img src={logo} alt="logo" style={{height: '41px', margin: '60px 0 40px 0', cursor: 'pointer'}} /></a>
      </div>
      <CardPageWrap>
        <h1 style={{margin: '0 auto', maxWidth: '740px', textAlign: 'center'}}>Hey, welcome back!</h1>
        <CardWrap>
          <Card>
            <form>
              <div style={{display: 'grid', gap: '32px'}}>
                <InputWrap>
                  <h3>Username</h3>
                  <div>
                    {/* <div className="label" >Name</div> */}
                    <input name="name" class="css-1dn0ixc" placeholder="Name" value="" />
                  </div>
                </InputWrap>
              </div>
            </form>
          </Card>
        </CardWrap>
      </CardPageWrap>
    </div>
  )
}


const CardPageWrap = styled.div`
  width: 100%;
  max-width: 1200px;
  margin-left: auto;
  margin-right: auto;
  padding: 0 24px;
`;

const CardWrap = styled.div`
  display: grid;
  margin: 0;
  gap: 24px;
  padding: 24px 0;

  @media (min-width: 640px) {
    padding: 32px 0;
  }

  @media (min-width: 832px) {
    padding: 64px 48px;
  }
`;

const Card = styled.div`
  display: block;
  padding: 24px;
  box-shadow: var(--shadow);
  background-color: var(--base-10);
  max-width: 740px;
  border-radius: var(--br-lg);

  @media (min-width: 640px) {
    padding: 0 32px;
  }

  @media (min-width: 832px) {
    padding: 32px 48px;
    margin: 0 auto;
    width: 100%;
  }
`;

const InputWrap = styled.div`
  display: grid;
  gap: 64px;
  grid-template-columns: 250px auto;

  &.label {
    position: absolute;
    top: 10px;
    left: 20px;
    font-size: var(--fs-b3);
    pointer-eents: none;
    transform: translateY(1px);
  }
`;
